import { HttpAuth } from '../../config/Http';

function payment(){
  HttpAuth.post('checkout')
  .then(data => (
    {
      itemsId: localStorage.getItem('storeCart')
    }
  ))
}

export default function Payment(){
  return (
    <>
      {payment()}
    </>
  )
}
